components/amp/styles/footer:
.amp-footer-heading {
  color: {{color_headings}};
}

.social-nav {
  padding-bottom: 60px;
  margin-bottom: 30px;
  border-bottom: 1px solid {{color_borders}};
}

.social-nav-list {
  list-style: none;
  text-align: left;
  margin-left: 0;
}

.social-link {
  display: inline-block;
  margin-right: 15px;
}

.social-link svg {
  fill: currentColor;
}
